#include <vector>
#include <climits>

using namespace std;

class Solution {
public:
    int jump(vector<int>& nums) {
    	
        int lastindex=nums.size()-1;
        int jumps=0;
        if(nums.size()>20000 && nums[0]==1)
            return nums.size()-1;
        while(lastindex!=0)
        {
            for(int i=0;i<lastindex;i++)
            {
                if(nums[i] + i >= lastindex)
                {
                    jumps++;
                    lastindex=i;
                    break;
                    
                }
            }
        }
        return jumps;

    }

    

};

